import React from "react";

const Home = () => {
  const displayBanner = (
    <div style={{ minHeight: "100vh" }}>
      <div>PRODUCTION HOUSE</div>
      <div style={{ fontSize: "85px" }}>IN METAVERSE</div>
    </div>
  );

  return (
    <div>
      <div>{displayBanner}</div>
    </div>
  );
};

export default Home;
